import Link from 'next/link';

const Wrapper = props => (
  <section className="container mx-auto px-6 py-12 lg:py-20" {...props} />
);

const CFP = () => {

  return (
    <React.Fragment>
    <section
    className="bg-cover bg-purple-800 pb-32 pt-8"
    style={{
      clipPath: 'polygon(0% 0%, 100% 0%, 100% 66%, 0% 100%)',
    }}
  >
      </section>
    </React.Fragment>
  );
};



export default CFP;
